import Home from '~/pages/Home';
import Following from '~/pages/Following';
import Profile from '~/pages/Profile';
import Upload from '~/pages/Upload';
import { UploadLayout } from '~/components/Layout';
const publicRoutes = [
    {
        path: '/',
        name: 'Home',
        component: Home,
    },
    {
        path: '/following',
        name: 'Following',
        component: Following,
    },
    {
        path: '/profile',
        name: 'Profile',
        component: Profile,
    },
    {
        path: '/upload',
        name: 'Upload',
        component: Upload,
        layout: UploadLayout,
    },
];
const privateRoutes = [];
export { publicRoutes, privateRoutes };
